DECLARE @MigrationName VARCHAR(200);
SET @MigrationName = '0003 - Import curve numbers'

IF NOT EXISTS(SELECT * FROM dbo.DatabaseMigration DM WHERE DM.ReleaseScriptFileName = @MigrationName)
BEGIN

	PRINT @MigrationName;

    CREATE TABLE #TempCurveNumbers(
		WellTPID VARCHAR(56),
		HydrologicSoilGroup VARCHAR(3),
		MTillCurveNumber FLOAT, 
		STillCurveNumber FLOAT, 
		NTillCurveNumber FLOAT, 
		CTillCurveNumber FLOAT, 
		UndefinedTillCurveNumber FLOAT
	);
		

	SELECT 
		IU.AgHubIrrigationUnitID
	,	TCN.HydrologicSoilGroup
	,	TCN.MTillCurveNumber
	,	TCN.STillCurveNumber
	,	TCN.NTillCurveNumber
	,	TCN.CTillCurveNumber
	,	TCN.UndefinedTillCurveNumber
	FROM #TempCurveNumbers			TCN
	JOIN dbo.AgHubIrrigationUnit	IU ON IU.WellTPID = TCN.WellTPID

	DROP TABLE #TempCurveNumbers;

    SELECT 'Mikey Knowles', @MigrationName
END